import Header from './Header';
import Menu from './Menu';
import Footer from './Footer';
import './App.css';
import { Route } from 'react-router';

export default class App extends Component {
  render() {
    return (
      <div className='App'>
        <Route path={'/header'} exact component={Header} />
        <Menu />
        <Footer />
      </div>
    );
  }
}
